import React from "react";

const App = () => {
  const greeting = "Hello Lambda!";
  return (
    <div >
      <img
        src="https://i.pinimg.com/originals/92/94/ba/9294badee7b8f3d93fa9bc6c874641b2.png"
        alt="lightbulb"
      />
    </div>
  );
};

export default App;
